INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1052501043, /*drama_id*/1052501, /*command_type*/11, /*param_01*/105211, /*param_02*/"おめでとうって言ってもらえるだけでも\nうれしいのに、手作りのケーキまで……\n私、あなたにいろんなものを\nもらってばっかりね。", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
