INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1052501046, /*drama_id*/1052501, /*command_type*/11, /*param_01*/105211, /*param_02*/"少しでもお返ししたいけど……\nあなたは何かしてほしいことはある？\nえ？　私の誕生日だから私が\n喜んでくれたらうれしい……？", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
