INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1052501049, /*drama_id*/1052501, /*command_type*/11, /*param_01*/105211, /*param_02*/"私、もう十分に喜んでるわ！\nでも、あなたのそんな言葉を聞いたら\nもう少しわがままを\n言いたくなっちゃうわ。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
